public List<QName> getDuplicatedQNames() {
  List<QName> duplicates = new ArrayList<QName>();
  for (Map.Entry<QName, List<XMLEvent>> e : qNameXMLEventsMap.entrySet()) {
    if (1 < e.getValue().size()) {
      duplicates.add(e.getKey());
    }
  }
  return duplicates;
}
